Ваша задача - обработать DXF файл и создать текстовый файл, который будет содержать информацию о поперечниках и их границах. Для этого вам нужно будет обрабатывать текстовые объекты (TEXT и MTEXT) и определить границы поперечников по определенным правилам. Вот пример кода, который реализует эту логику:

1. Ищем тексты с форматом `ПК7+80; ПК8+30,33;` и т.д.
2. Определяем границы поперечников на основе расположения текстов.
3. Сохраняем результаты в текстовый файл.

```python
import ezdxf
import re
import os

def select_file():
    """Функция для выбора DXF файла."""
    root = tk.Tk()
    root.withdraw()  # Скрыть главное окно
    file_path = filedialog.askopenfilename(title="Выберите файл DXF", filetypes=[("DXF files", "*.dxf")])
    return file_path

def write_entities_to_txt(dxf_file_path, output_file_path):
    """Функция для записи сущностей из DXF файла в текстовый файл."""
    doc = ezdxf.readfile(dxf_file_path)
    with open(output_file_path, 'w', encoding='utf-8') as output_file:
        for entity in doc.modelspace().query('*'):
            if entity.dxftype() == 'TEXT' or entity.dxftype() == 'MTEXT':
                text = entity.dxf.text
                if re.match(r'^ПК\d+\+\d+\.?\d*\.|^PК\d+\+\d+\.?\d*$', text):
                    output_file.write(f"Пикет: {text} ({entity.dxf.insert.x}, {entity.dxf.insert.y})\n")

def find_pier_boundaries(entities):
    """Функция для обнаружения границ поперечников."""
    pier_boundaries = []
    pier_texts = []
    for entity in entities:
        if entity.dxftype() == 'TEXT' or entity.dxftype() == 'MTEXT':
            pier_texts.append(entity.dxf.insert)
            pier_texts.sort(key=lambda x: x[1])  # Сортируем по координате Y

    if len(pier_texts) > 1:
        y_diff = pier_texts[1][1] - pier_texts[0][1]
        if y_diff < 0.1:
            # Проверка на горизонтальность
            for entity in entities:
                if entity.dxftype() == 'LINE' or entity.dxftype() == 'LWPOLYLINE':
                    if abs(entity.dxf.start.y - entity.dxf.end.y) < 0.1:
                        pier_boundaries.append(entity.dxf.start)
                        pier_boundaries.append(entity.dxf.end)
                        break
                    elif abs(entity.dxf.start.y - entity.dxf.end.y) > y_diff:
                        pier_boundaries.append(entity.dxf.start)
                        break
                elif entity.dxftype() == 'TEXT' or entity.dxftype() == 'MTEXT':
                    pier_boundaries.append(entity.dxf.insert)
            if len(pier_boundaries) > 0:
                return pier_boundaries
    return None

def main():
    dxf_file_path = select_file()
    if dxf_file_path:
        output_file_path = dxf_file_path.replace('.dxf', '.txt')
        write_entities_to_txt(dxf_file_path, output_file_path)
        doc = ezdxf.readfile(dxf_file_path)
        entities = list(doc.modelspace().query('*'))
        pier_boundaries = find_pier_boundaries(entities)
        if pier_boundaries:
            with open(output_file_path, 'a', encoding='utf-8') as output_file:
                for boundary in pier_boundaries:
                    output_file.write(f"Граница поперечника: ({boundary[0]}, {boundary[1]})\n")
        print(f"Данные успешно записаны в файл: {output_file_path}")
    else:
        print("Файл не выбран.")

if __name__ == "__main__":
    main()
```

Этот код делает следующее:
1. Считывает DXF файл и записывает текстовые объекты в текстовый файл.
2. Ищет текстовые объекты с форматом `ПК7+80; ПК8+30,33;` и т.д.
3. Определяет границы поперечников на основе расположения текстовых объектов.
4. Сохраняет результаты в текстовый файл.

Этот скрипт является начальной версией и может требовать дополнительных доработок в зависимости от конкретных требований и формата DXF файла.

